import React, { Component } from "react";
import { Animated } from "react-animated-css";
import Toolbar from "@material-ui/core/Toolbar";
import Button from "@material-ui/core/Button";
import "./main.css";

class Main extends Component {
  render() {
    return (
      <React.Fragment>
        <div className="root">
          <Toolbar>
            <Button id="buttons" href="about">
              About
            </Button>
            <Button id="buttons" href="contact">
              Contact
            </Button>
          </Toolbar>
        </div>

        <div className="showCase">
          <Animated
            animationIn="fadeInRight"
            animationOut="fadeOut"
            isVisible={true}
          >
            <h1>Universa Localis</h1>
          </Animated>
          <p>
            <strong>The whole universe on your secreen</strong>
          </p>
        </div>
        <img
          className="icons"
          src="https://upload.wikimedia.org/wikipedia/commons/thumb/e/e5/NASA_logo.svg/2000px-NASA_logo.svg.png"
          alt="TheMet"
        />
        <div className="loadingStyle">
          <h1>{this.props.title}</h1>
          <h3 style={{}}>{this.props.content}</h3>
          <img className="imgStyle" src={this.props.image} alt="" />
        </div>
      </React.Fragment>
    );
  }
}

export default Main;
